  true,\n\t\"url\": null,\n\t\"notes\": \"U.S. Geological Survey, Department of the
  Interior - The annual National Map Corps Volunteered Geographic Information (VGI)
  structures acquisition plan is to add new structures data and remove or edit obsolete
  structures data points over the United States. The FY17 acquisition plan allows
  data contributions by volunteers for all 50 states. Interested parties who wish
  to become a volunteer data acquisition partner with the USGS in FY17 or in future
  years should contact a USGS Geospatial Liaison - http://liaisons.usgs.gov/geospatial/documents/TNM_Partnership_User_ContactList.pdf.
  To find out more about the National Map Corps VGI structures program go to https://my.usgs.gov/confluence/display/nationalmapcorps/Home.\",\n\t\"license_title\":
